import React from 'react';
import { Grommet } from 'grommet';

const theme = {
  global: {
    font: {
      family: 'Roboto',
      size: '18px',
      height: '20px',
    },
  },
};

function App() {
  return <Grommet theme={theme} full></Grommet>

}

export default App;
